import styled from 'styled-components';


export const NavigationBar = styled.nav`
  font-family: 'Lato', sans-serif;
  display: flex;
  justify-content: flex-end;
  width: 100%;
  height: 20%;

    .home {
      font-size: 2em;
      color: white;
      margin-left: 0;
      margin-top: 40px;
      width: 207px; 
      height: 25px; 
    }

    .uList {
      display: flex;
      justify-content: flex-end;
      align-items: center;
      height: 15%;
      width: 50%;
      padding-right: 128px;
    
        li {
          filter: brightness();
          font-size: 15px;
          list-style: none;
          color: white;
          padding: 23.5px;
        }

        img {
          width: 24px;
          height: 26px;
          padding-left: 47px;
        }
  }

  
  }
  
`;
